import classes from './Sections.module.css';
import { useHistory } from 'react-router';

const Sections = () => {
    const history = useHistory();
    const openSection = (evt) => {
        debugger
        history.push('/section/');
    }

    return (
        <>
            <div className={classes.tiles} onClick={openSection}>
                <h3>Technology</h3>
            </div>
            <div className={classes.tiles} onClick={openSection}>
                <h3>Psychology</h3>
            </div>
            <div className={classes.tiles} onClick={openSection}>
                <h3>Books</h3>
            </div>
            <div className={classes.tiles} onClick={openSection}>
                <h3>Philosophy</h3>
            </div>
            <div className={classes.tiles} onClick={openSection}>
                <h3>Food</h3>
            </div>
            <div className={classes.tiles} onClick={openSection}>
                <h3>Health</h3>
            </div>

        </>
    );
}

export default Sections;
